import {
  SEARCH_FILTER,
} from '../actions'

const filterInitial = {
  filterByName:'',
}
const search = (state = filterInitial, action) => {
  switch(action.type) {
    case SEARCH_FILTER:
      return {
        ...state,
        filterByName: action.payload,
      };
      default:
        return {
          state
        };
    }
}


export default search;
